import logo from './logo.svg';
import search_image from './search.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="dropdown">
          <a href="#goto" class="dropdownButton">Go To</a>
          <div class="dropdown-content">
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
          </div>
        </div>
    </div>
  );
}

export default App;
